  return (
    <div className='relative w-screen h-full'>
      <div className='fixed pr-40'>
        <Sidebar />
      </div>

      <div className='pl-32'>
        <div className='grid grid-cols-3 px-8 gap-8'>
          <div className='col-span-full'>
            <Title />
          </div>
          <div className='col-span-2'>
            <StructureBuilder />
          </div>
          <div className='col-span-1'>
            <Modeler />
          </div>
        </div>
      </div>

    </div>
  )
}
